import React from "react";

function Jumbotron({ children }) {
  return (



    <section class="hero is-primary" style={{textAlign: "center", alignContent: "center"}}>
    <div class="hero-body">
      <div class="container">
        <h1 class="title">
          Primary title
        </h1>
        <h2 class="subtitle">
          Primary subtitle
        </h2>
      </div>
    </div>
    {children}
  </section>
  );
}

export default Jumbotron;
